column23:
{'QuestionID': 641, 'Answer': 5, 'AnswerList': None, 'Info': 'Samfundsforandringer af denne karakter skal støttes af det politiske system. Ligestilling på dette område er kompliceret af ubeviste samfundsmønstre og strukturer som går helt tilbage til børneopdragelsen.
For at få sat skub i ligestillingen på området, er kvoter et af mange håndtag.
 
', 'IsImportant': 0, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 102}

column4:
{'QuestionID': 613, 'Answer': 5, 'AnswerList': None, 'Info': 'Lige så snart vores ukrainske venner lever op til kravene ift. økonomi og korruption, skal vi byde dem velkommen i vores europæiske fællesskab. 

Kort før jul rejste jeg selv rundt i Ukraine. Både i befolkningens hjem, på restauranter og på caféer flager de med EU-flag. 

Ukrainerne ved nemlig godt, at deres bedste garanti for en god og sikker fremtid er ved at orientere sig mod Vesten. ', 'IsImportant': 1, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 110}

column16:
{'QuestionID': 629, 'Answer': 2, 'AnswerList': None, 'Info': "Der er behov for at gøre langt mere for den grønne omstilling, end vi gør i dag. 

Derfor støtter jeg EU's klimalov om at blive CO2-neutrale i år 2050. Men det er slet og ret urealistisk, at vi skulle kunne stoppe brugen fossile brændsler på kun 6 år. 

Hvis vi forsøgte dét, ville det kun gøre os mere afhængige af Rusland og Mellemøsten. ", 'IsImportant': 0, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': False, 'ID': 110}

column3:
{'QuestionID': 612, 'Answer': 5, 'AnswerList': None, 'Info': 'Vi er for sårbare, når vitale produkter gennem de seneste mange år er outsourcet til udlandet. Aktuelt er der mangel på flere medicinske præparater. 
Ved en "hjemtagning" bliver vi både mindre sårbare, og kan indtænke bæredygtighed og grøn omstilling i produktionen fremover.

Desuden kan outsourcing øge social ulighed ved, at finansiere underbetaling og dårligt arbejdsmiljø i 3.lande. ', 'IsImportant': 1, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 3}

column2:
{'QuestionID': 609, 'Answer': 1, 'AnswerList': None, 'Info': "Det er vigtigt at vi overholder Schengen aftalen. 
Det skal nemlig være nemt for dansker at rejse frit rundt i Europa.

Grænsekontrolen skal selvfølgelig foregår der hvor det er nødvendigt, nemlig ved EU's ydre grænser. ", 'IsImportant': 0, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 181}

column5:
{'QuestionID': 614, 'Answer': 5, 'AnswerList': None, 'Info': 'Personer som f.eks. V. Orbán (ungarn) skal ikke kunne sidde og blokere for beslutninger. Det bør ikke være et enkelt land der kan forhindre eksempelvis ydereligere sektioner mod lande som Rusland. 

Derfor mener vi i Liberal Alliance at det må være en kvalificeret flertal der vejer tungest.  
', 'IsImportant': 0, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 181}

column10:
{'QuestionID': 620, 'Answer': 5, 'AnswerList': None, 'Info': 'Presset på grænserne har ikke været større siden 2016. 
Vores ydre grænser og presset - det er en alvorlig situationen, og derfor skal vi selvfølgelig gøre brug af alle de metoder der kan hjælpe på situationen.

EUs udlandsbistand skal afhænge af om de pågælende lande bidrager til at begrænse den migration vi i øjeblikket oplever. ', 'IsImportant': 0, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 181}

column2:
{'QuestionID': 609, 'Answer': 2, 'AnswerList': None, 'Info': 'Det er godt, at vi kan bevæge os frit rundt i Europa. Det er vigtigt for handelen og dermed økonomien, at varer og arbejdskraft smidigt kan bevæge sig over landegrænserne.

Men Europas ydre grænser er ikke effektive. De senere år har vi set store udslag i antallet af illegale migranter og personer, der søger asyl i Danmark og Europa. Derfor har vi måttet indføre midlertidig grænsekontrol. 

', 'IsImportant': 0, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 26}

{'QuestionID': 609, 'Answer': 1, 'AnswerList': None, 'Info': "Friheden til at rejse frit i Europa er vigtigt! Lad os styrke Europa's ydre grænser i stedet, så vi kan holde de indre grænser åbne via Schengen. 

Det er op til staterne om de vil have grænsekontrol, men vi spilder ufattelige ressourcer på kombardo-arbejde. Lad i stedet politiet selv prioritere opgaverne. Læs om det her:

https://tjliberal.dk/drop-kombardo-arbejdet ", 'IsImportant': 0, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 111}

column23:
{'QuestionID': 641, 'Answer': 1, 'AnswerList': None, 'Info': 'Kønskvoter er statsautoriseret kønsdiskrimination.

Tænk at man forsøger at bekæmpe et problem ved at indføre diskriminerende tiltag, hvor en dygtigere mandlig kandidat kan blive vraget på grund af sit køn. 

Virksomhederne kan sagtens selv sammensætte sin bestyrelse - kønskvoter har ingen gang på jord.', 'IsImportant': 1, 'ID_CandidateQuestionType': 1, 'IsTopicQuestionType': True, 'ID': 111}
